import React, { Component } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import '../css/home.css'

export default class AdminHome extends Component {
    render() {
        return (
            <div>
                <h1 style="margin-left: 25ex;">Admin HomePage</h1>
                <div class="container h-100"> 
                    <div class="position-relative h-100"> 
                    
                        <div class="position-absolute top-center"> 
                        <button onclick="document.location.href = '/register'" type="button" class="btn btn-primary custom">Add a new User</button> 
                        </div> 
                    
                        <div class="position-absolute mid-center"> 
                            <button onclick="document.location.href = '/changepassword'" type="button" class="btn btn-primary custom">Change Password</button> 
                        </div> 
                
        
                        <div class="position-absolute bottom-center"> 
                            <button type="button" class="btn btn-primary custom">Add Prescription</button> 
                        </div>
                
                    </div>
                </div>
            </div>
        )
    }
}
